function ChatServerLogic:HandlerClientAction(serverId, userId, subMsgId, data, token)

    --local start = GetOsTimeMillisecond()
    if subMsgId == SUB_C_LOGIN then
        self:ClientSubLoginAction(serverId, userId, data, token)
    elseif subMsgId == SUB_C_FRIEND_LIST then
        self:ClientSubGetFriendListAction(serverId, userId, data, token)
    elseif subMsgId == SUB_C_SEARCH_USER then
        self:ClientSubSearchUserAction(serverId, userId, data, token)
    elseif subMsgId == SUB_C_APPLY_FRIEND then
        self:ClientSubApplyFriendAction(serverId, userId, data, token)
    elseif subMsgId == SUB_C_DELETE_FRIEND then
        self:ClientSubDeleteFriendAction(serverId, userId, data, token)
    elseif subMsgId == SUB_C_GET_CHAT_MESSAGE then
        self:ClientSubGetChatUnreadMessage(serverId, userId, data, token)
    elseif subMsgId == SUB_C_CHAT_MESSAGE then
        self:ClientSubChatMessage(serverId, userId, data, token)
    elseif subMsgId == SUB_C_HEARTBEAT_CHAT then
        self:ClientSubHeartbeat(serverId, userId, data, token)
    end
    --local endtime = GetOsTimeMillisecond()
    --Logger(string.format("ChatServerFace:HandlerClientAction:subMsgId=[%d] 耗时 %d ms", subMsgId, endtime - start));
end